def get_translations(
    ):
    '''Saves translations in the current directory'''
    types = {0: ".mo", 1: ".po"}
    current_path = '/content/'
    directorys = {0:'locales', 1:'en', 2:'LC_MESSAGES'}

    for k in range(0, 3):
        if k == 0:
            cp = os.path.join(current_path, directorys[k])
            os.mkdir(cp)
        elif k == 1:
            cp = os.path.join(cp, directorys[k])
            os.mkdir(cp)
        elif k == 2:
            cp = os.path.join(cp, directorys[k])
            os.mkdir(cp)

            for i in range(0, 2):
                file_name = "base{0}".format(types[i])

                fn = cp + '/' + file_name

                #print(fn)
                
                dt = base64.decodebytes(translation_dict[i]) 
                with open(fn, 'wb') as f:
                    f.write(dt)

